import React from 'react';
import Link from 'next/link';

const Pokemon = ({ pokemon, pokemonUrl}) => {

    const { name, image } = pokemon;
    console.log(pokemonUrl)

    return (
        <li>
            <h3>
                { name }
            </h3>
            {/* <Link>
                <a><img src = {image} alt = "Pokemon Image" /></a>
            </Link> */}
            
        </li>
    );
}
 
export default Pokemon;
